import * as React from "react";
import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

type AppState = {
  apiResponse: string;
};

export default class App extends Component<{}, AppState> {
  state: AppState = {
    apiResponse: "",
  };

  render() {
    return <h1>{this.state.apiResponse}</h1>;
  }
}
